import React from 'react'
import './TreeItemWrapper.css'

const TreeItemWrapper = (props) => {
    return (
        <div className="tree-item-wrapper" style={{paddingLeft: '20px', cursor: 'pointer', paddingTop: '10px'}}>
            {props.children}
        </div>
    )
}

export default TreeItemWrapper
